# Nikolayevka, Alataninsky Selsoviet, Sterlitamaksky District, Republic of Bashkortostan

}}
Nikolayevka () is a rural locality (a selo) in Alataninsky Selsoviet, Sterlitamaksky District, Bashkortostan, Russia. The population was 66 as of 2010.
Geography
It is located 29&nbsp;km from Sterlitamak, 4&nbsp;km from Alatana.
